: rgb(255, 237, 196);\"><span style=\"font-family:微软雅黑, &amp;quot;;word-wrap: break-word;\"><span style=\"word-wrap: break-word; font-size: 13px;\">有一张人员表和部门表，因为人员表只有部门的ID，怎么让查询结果显示部门名字</span></span></span></span><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(68, 68, 68); font-family: Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">&nbsp; &nbsp;&nbsp;&nbsp;处理方案： 通过针对分页查询的结果集，进行循环处理处理（拓展字段）</span><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(68, 68, 68); font-family: Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">&nbsp; &nbsp;&nbsp;</span><ignore_js_op style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"><img id=\"aimg_14341\" aid=\"14341\" src=\"http://www.jeecg.org/data/attachment/forum/201703/09/102331e8jxs5ppwpld4jxz.png\" zoomfile=\"data/attachment/forum/201703/09/102331e8jxs5ppwpld4jxz.png\" file=\"data/attachment/forum/201703/09/102331e8jxs5ppwpld4jxz.png\" class=\"zoom\" width=\"600\" inpost=\"1\" alt=\"QQ图片20170309102300.png\" title=\"QQ图片20170309102300.png\" lazyloaded=\"true\" _load=\"1\" style=\"word-wrap: break-word; cursor: pointer;\"/></ignore_js_op><span style=\"color: rgb(68, 68, 68); font-family: Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\"></span></p><ol style=\"word-wrap: break-word; margin-left: 10px !important; padding: 0px !important;\" class=\" list-paddingleft-2\"><li><p>this.gzUserInfoYwService.getDataGridReturn(cq, true);<br style=\"word-wrap: break-word;\"/></p></li><li><p>List&lt;GzUserInfoYw&gt; gzUserInfoList = dataGrid.getResults();<br style=\"word-wrap: break-word;\"/></p></li><li><p>Map&lt;String,Map&lt;String,Object&gt;&gt; extMap = new HashMap&lt;String, Map&lt;String,Object&gt;&gt;();<br style=\"word-wrap: break-word;\"/></p></li><li><p>for(GzUserInfoYw temp:gzUserInfoList){<br style=\"word-wrap: break-word;\"/></p></li><li><p>&nbsp; &nbsp;&nbsp; &nbsp;&nbsp;&nbsp;//此为针对原来的行数据，拓展的新字段<br style=\"word-wrap: break-word;\"/></p></li><li><p>&nbsp; &nbsp;&nbsp; &nbsp;&nbsp;&nbsp;Map m = new HashMap();<br style=\"word-wrap: break-word;\"/></p></li><li><p>&nbsp; &nbsp;&nbsp; &nbsp;&nbsp;&nbsp;m.put(&quot;departmentName&quot;, &quot;财务部&quot;);<br style=\"word-wrap: break-word;\"/></p></li><li><p>&nbsp; &nbsp;&nbsp; &nbsp;&nbsp;&nbsp;m.put(&quot;orgName&quot;, &quot;组织机构名称&quot;);<br style=\"word-wrap: break-word;\"/></p></li><li><p>&nbsp; &nbsp;&nbsp; &nbsp;&nbsp;&nbsp;extMap.put(temp.getId(), m);<br style=\"word-wrap: break-word;\"/></p></li><li><p>}<br style=\"word-wrap: break-word;\"/></p></li><li><p>TagUtil.datagrid(response, dataGrid,extMap);</p></li></ol><p><span style=\"word-wrap: break-word; margin-left: 43px; font-size: 12px; cursor: pointer; color: rgb(51, 102, 153) !important;\">复制代码</span></p><p><span style=\"word-wrap: break-word; font-weight: 700; color: rgb(68, 68, 68); font-family: Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">JSP页面用法（跟实体字段一样）：</span><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><ignore_js_op style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"><img id=\"aimg_14385\" aid=\"14385\" src=\"http://www.jeecg.org/data/attachment/forum/201703/21/175