><span style=\"color: rgb(68, 68, 68); font-family: Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;//Online默认样式：default(easyui)&nbsp;&nbsp;</span><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(68, 68, 68); font-family: Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;&nbsp; &nbsp;// Online默认样式：ledefault(ace)</span><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"word-wrap: break-word; font-weight: 700; color: rgb(68, 68, 68); font-family: Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\"><br style=\"word-wrap: break-word;\"/>46. jeecg上传附件简易方案</span><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(68, 68, 68); font-family: Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">&nbsp; &nbsp;&nbsp;&nbsp;</span><a href=\"http://www.jeecg.org/forum.php?mod=viewthread&tid=935&extra=page%3D1\" target=\"_blank\" style=\"word-wrap: break-word; color: rgb(51, 102, 153); font-family: Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\">http://www.jeecg.org/forum.php?mod=viewthread&amp;tid=935&amp;extra=page%3D1</a><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"word-wrap: break-word; font-weight: 700; color: rgb(68, 68, 68); font-family: Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">47.jeecg 上传组件，打开很慢问题解决</span><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(68, 68, 68); font-family: Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">&nbsp; &nbsp;&nbsp;&nbsp;</span><span style=\"color:#333333;word-wrap: break-word; font-family: Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"font-family:&amp;quot;;word-wrap: break-word;\">fileTypeExts包含zip,rar 就会延迟打开,建议不限制 fileTypeExts</span></span><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(68, 68, 68); font-family: Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">&nbsp; &nbsp;&nbsp;</span><span style=\"word-wrap: break-word; font-weight: 700; color: rgb(68, 68, 68); font-family: Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">原因看文章：</span><a href=\"https://segmentfault.com/q/1010000007501929/a-1020000007546108\" target=\"_blank\" style=\"word-wrap: break-word; color: rgb(51, 102, 153); font-family: Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\">https://segmentfault.com/q/1010000007501929/a-1020000007546108</a><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"word-wrap: break-word; font-weight: 700; color: rgb(68, 68, 68); font-family: Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">48. 项目Maven<span style=\"color:#3d464d;word-wrap: break-word;\"><span style=\"word-wrap: break-word; background-color: rgb(248, 248, 248);\"><span style=\"font-family:&amp;quot;;word-wrap: break-word;\"><span style=\"word-wrap: break-word; font-size: 16px;\">启动报错</span></span></span></span></span><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color:#3d464d;word-wrap: break-word; font-family: Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"word-wrap: break-word; background-color: rgb(248, 248, 248);\"><span style=\"font-family:&amp;quot;;word-wrap: break-word;\"><span style=\"word-wrap: break-word; font-size: 16px;\">&nbsp; &nbsp;&nbsp; &nbsp;The argument does not represent an annotation type: ContextConfiguration</span></span></span></span><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(68, 68, 68); font-family: Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">&nbsp; &nbsp;&nbsp; &nbsp;</span><img id=\"aimg_H0aem\" class=\"zoom\" file=\"https://static.oschina.net/uploads/space/2017/0110/152827_ZHDu_2328605.png\" border=\"0\" alt=\"\" src=\"https://static.oschina.net/uploads/space/2017/0110/152827_ZHDu_2328605.png\" lazyloaded=\"true\" _load=\"1\" style=\"word-wrap: break-word; cursor: pointer; color: rgb(68, 68, 68); font-family: Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(68, 68, 68); font-family: Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">&nbsp;&nbsp;</span><span style=\"word-wrap: break-word; font-weight: 700; color: rgb(68, 68, 68); font-family: Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">&nbsp;解决方案（需修改两点）：</span></p><table cellspacing=\"0\" class=\"t_table\" width=\"377\"><tbody style=\"word-wrap: break-word;\"><tr style=\"word-wrap: break-word;\" class=\"firstRow\"><td style=\"word-wrap: break-word; padding: 4px; border-color: rgb(227, 237, 245); overflow: hidden;\">1. org.jeecgframework.core.junit.AbstractUnitTest 类的依赖类 需要导入本地junit4 测试包<ol style=\"word-wrap: break-word; margin-left: 10px !important; padding: 0px !important;\" class=\" list-paddingleft-2\"><li><p>&lt;!-- spring --&gt;<br style=\"word-wrap: break-word;\"/></p></li><li><p>&lt;dependency&gt;<br style=\"word-wrap: break-word;\"/></p></li><li><p>&lt;groupId&gt;org.springframework&lt;/groupId&gt;<br style=\"word-wrap: break-word;\"/></p></li><li><p>&lt;artifactId&gt;spring-test&lt;/artifactId&gt;<br style=\"word-wrap: break-word;\"/></p></li><li><p>&lt;version&gt;${spring.version}&lt;/version&gt;<br style=\"word-wrap: break-word;\"/></p></li><li><p>&lt;/dependency&gt;</p></li></ol><p><span style=\"word-wrap: break-word; margin-left: 43px; font-size: 12px; cursor: pointer; color: rgb(51, 102, 153) !important;\">复制代码</span></p>注释： 把原来的<span style=\"word-wrap: break-word; font-weight: 700;\"><span style=\"color:#ff0000;word-wrap: break-word;\">&lt;scope&gt;test&lt;/scope&gt;</span></span>去掉<br style=\"word-wrap: break-word;\"/><br style=\"word-wrap: break-word;\"/>2. 讲类AbstractUnitTest改成抽象类<ol style=\"word-wrap: break-word; margin-left: 10px !important; padding: 0px !important;\" class=\" list-paddingleft-2\"><li><p>public &lt;b&gt;&lt;font color=&quot;#ff0000&quot;&gt;abstract &lt;/font&gt;&lt;/b&gt;class AbstractUnitTest</p></li></ol><p><span style=\"word-wrap: break-word; margin-left: 43px; font-size: 12px; cursor: pointer; color: rgb(51, 102, 153) !important;\">复制代码</span></p></td></tr></tbody></table><p><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"word-wrap: break-word; font-weight: 700; color: rgb(68, 68, 68); font-family: Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">50. 在页面当中打开一个新的tab页面 ,弹出窗口，提示消息等通用JS都在文件</span><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"word-wrap: break-word; font-weight: 700; color: rgb(68, 68, 68); font-family: Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">&nbsp; &nbsp;<span style=\"color:#3d464d;word-wrap: break-word;\"><span style=\"word-wrap: break-word; background-color: rgb(248, 248, 248);\"><span style=\"font-family:&amp;quot;;word-wrap: break-word;\"><span style=\"word-wrap: break-word; font-size: 16px;\">curdtool*.js （分中文和英文）</span></span></span></span></span><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(68, 68, 68); font-family: Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">&nbsp; &nbsp; 路径： src/main/webapp/plug-in/tools/curdtools_zh-cn.js</span><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"word-wrap: break-word; font-weight: 700; color: rgb(68, 68, 68); font-family: Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">51.&nbsp;<span style=\"color:#3d464d;word-wrap: break-word;\"><span style=\"word-wrap: break-word; background-color: rgb(248, 248, 248);\"><span style=\"font-family:&amp;quot;;word-wrap: break-word;\"><span style=\"word-wrap: break-word; font-size: 16px;\">弹出窗口增加按钮</span></span></span></span></span></p><ol style=\"word-wrap: break-word; margin-left: 10px !important; padding: 0px !important;\" class=\" list-paddingleft-2\"><li><p>重写plug-in/tools/curdtools_zh-cn.js文件中createdetailwindow方法（重命名），复制重写的方法到对应的 *-list文件中，修改录入、修改、查看或者删除方法的调用方法名为重写的方法<br style=\"word-wrap: break-word;\"/></p></li><li><p>弹窗组件API 参考网址 http://www.lhgdialog.com/</p></li></ol><p><span style=\"word-wrap: break-word; margin-left: 43px; font-size: 12px; cursor: pointer; color: rgb(51, 102, 153) !important;\">复制代码</span></p><p><span style=\"word-wrap: break-word; font-weight: 700; color: rgb(68, 68, 68); font-family: Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">52.&nbsp;<span style=\"color:#3d464d;word-wrap: break-word;\"><span style=\"word-wrap: break-word; background-color: rgb(248, 248, 248);\"><span style=\"font-family:&amp;quot;;word-wrap: break-word;\"><span style=\"word-wrap: break-word; font-size: 16px;\">获取当前登录用户信息</span></span></span></span></span></p><ol style=\"word-wrap: break-word; margin-left: 10px !important; padding: 0px !important;\" class=\" list-paddingleft-2\"><li><p>TSUser user = ResourceUtil.getSessionUserName();</p></li></ol><p><span style=\"word-wrap: break-word; margin-left: 43px; font-size: 12px; cursor: pointer; color: rgb(51, 102, 153) !important;\">复制代码</span></p><p><span style=\"word-wrap: break-word; font-weight: 700; color: rgb(68, 68, 68); font-family: Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">53. 获取当前日期</span></p><ol style=\"word-wrap: break-word; margin-left: 10px !important; padding: 0px !important;\" class=\" list-paddingleft-2\"><li><p>String date&nbsp;&nbsp;= DateUtils.date2Str(new Date(), DateUtils.date_sdf);</p></li></ol><p><span style=\"word-wrap: break-word; margin-left: 43px; font-size: 12px; cursor: pointer; color: rgb(51, 102, 153) !important;\">复制代码</span></p><p><span style=\"word-wrap: break-word; font-weight: 700; color: rgb(68, 68, 68); font-family: Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">54.&nbsp;<span style=\"word-wrap: break-word; background-color: rgb(248, 248, 248);\"><span style=\"word-wrap: break-word; font-size: 16px;\">rest风格请求地址调用方法</span></span></span></p><ol style=\"word-wrap: break-word; margin-left: 10px !important; padding: 0px !important;\" class=\" list-paddingleft-2\"><li><p>例如：<br style=\"word-wrap: break-word;\"/></p></li><li><p>查询list ：http://localhost:8080/系统名称/rest/tZzxtDictionaryController/<br style=\"word-wrap: break-word;\"/></p></li><li><p>查询1条数据：http://localhost:8080/系统名称/rest/tZzxtDictionaryController/{id}<br style=\"word-wrap: break-word;\"/></p></li><li><p>其他方法去对应的controller里面找</p></li></ol><p><span style=\"word-wrap: break-word; margin-left: 43px; font-size: 12px; cursor: pointer; color: rgb(51, 102, 153) !important;\">复制代码</span></p><p><span style=\"word-wrap: break-word; font-weight: 700; color: rgb(68, 68, 68); font-family: Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">55. 判断非空，转换string To int 等方法在工具类</span></p><ol style=\"word-wrap: break-word; margin-left: 10px !important; padding: 0px !important;\" class=\" list-paddingleft-2\"><li><p>org.jeecgframework.core.util.oConvertUtils</p></li></ol><p><span style=\"word-wrap: break-word; margin-left: 43px; font-size: 12px; cursor: pointer; color: rgb(51, 102, 153) !important;\">复制代码</span></p><p><span style=\"word-wrap: break-word; font-weight: 700; color: rgb(68, 68, 68); font-family: Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">56. 给列表单元格加背景色</span></p><ol style=\"word-wrap: break-word; margin-left: 10px !important; padding: 0px !important;\" class=\" list-paddingleft-2\"><li><p>&lt;t:dgCol title=&quot;任务类型&quot;&nbsp;&nbsp;field=&quot;type&quot; align=&quot;center&quot; extendParams=&quot;&#39;styler&#39;:fmtype;&quot; query=&quot;true&quot; queryMode=&quot;single&quot;&nbsp;&nbsp;width=&quot;100&quot;&gt;&lt;/t:dgCol&gt;</p></li></ol><p><span style=\"word-wrap: break-word; margin-left: 43px; font-size: 12px; cursor: pointer; color: rgb(51, 102, 153) !important;\">复制代码</span></p><p><span style=\"color: rgb(68, 68, 68); font-family: Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">extendParams属性添加js方法，然后再调用方法</span></p><ol style=\"word-wrap: break-word; margin-left: 10px !important; padding: 0px !important;\" class=\" list-paddingleft-2\"><li><p>function fmtype(val,row,index){<br style=\"word-wrap: break-word;\"/></p></li><li><p>&nbsp; &nbsp; var s1 = &#39;background-color: #f89406;;border-radius: 5px;color:#fff;&#39;;<br style=\"word-wrap: break-word;\"/></p></li><li><p>&nbsp; &nbsp; var s2 = &#39;background-color: #3a87ad;border-radius: 5px;color:#fff&#39;;<br style=\"word-wrap: break-word;\"/></p></li><li><p>&nbsp; &nbsp; if (val ==&#39;W&#39;) {<br style=\"word-wrap: break-word;\"/></p></li><li><p>&nbsp; &nbsp;&nbsp; &nbsp;&nbsp;&nbsp;return s1<br style=\"word-wrap: break-word;\"/></p></li><li><p>&nbsp; &nbsp; }<br style=\"word-wrap: break-word;\"/></p></li><li><p>&nbsp; &nbsp; if (val ==&#39;J&#39;) {<br style=\"word-wrap: break-word;\"/></p></li><li><p>&nbsp; &nbsp;&nbsp; &nbsp;&nbsp;&nbsp;return s2<br style=\"word-wrap: break-word;\"/></p></li><li><p>&nbsp; &nbsp; }<br style=\"word-wrap: break-word;\"/></p></li><li><p>}</p></li></ol><p><span style=\"word-wrap: break-word; margin-left: 43px; font-size: 12px; cursor: pointer; color: rgb(51, 102, 153) !important;\">复制代码</span></p><p><span style=\"word-wrap: break-word; font-weight: 700; color: rgb(68, 68, 68); font-family: Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">57. 上传控件不好用问题</span><br style=\"word-wrap: break-word; color: rgb(68, 68, 68); font-family: Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(68, 68, 68); font-family: Tahoma, Helvetica, SimSun, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">&nbsp; &nbsp;&nbsp; &nbsp;</span><span style=\"font-family:微软雅黑;word-wrap: break-word; color: rgb(68, 68, 68); font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\">&nbsp;<span style=\"font-size:16px;word-wrap: break-word;\"><span style=\"color:#000;word-wrap: break-word;\"><a href=\"http://blog.csdn.net/zhangdaiscott/article/details/28698385\" target=\"_blank\" style=\"word-wrap: break-word; color: rgb(51, 102, 153);\">Upload(上传标签)</a></span>采用flesh方式，不同的浏览器对flash支持不同，会出现上传有问题，建议重装flash组件</span></span></p><p><br/></p>', '01', '7777', '402881875988e889015988ec36770001');
